class MyHTMLParser(HTMLParser):
    row = []
    list = []
    _fill = False
    _firstSkipped = False
    _count = 0

    def handle_starttag(self, tag, attrs):
        if tag.lower() == 'tr' and self._firstSkipped:
            self.row = []
            self._fill = True
            self._count = 0
        elif tag.lower() == 'th':
            # don't treat a table row with headings the same
            self._fill = False
        elif tag.lower() == 'td':
            self._count += 1

    def handle_endtag(self, tag):
        if tag.lower() == 'tr':
            if not self._firstSkipped:
                self._firstSkipped = True
                return
            if self._fill and self._count == 9:
                self.list.append(self.row)
                self._fill = False

    def handle_data(self, data):
        if self._fill:
            self.row.append(data)

    def _adjustSyntax(self):
        for row in self.list:
            for i, col in enumerate(row):
                if col == '-':
                    row[i] = ''
            row[1] = row[1].replace(' ', '-')

    def feed(self, data: str) -> None:
        super().feed(data)
        self._adjustSyntax()

parser = MyHTMLParser()
parser.feed(rawHTML)
df = pd.DataFrame(parser.list, columns=('PLName', 'Name', 'LV', 'LSite', 'LDate', 'EDate', 'Life', 'Orbit', 'IntlDes'))
